import React from "react";

import "./custom-button.styles.sass";

const CustomButton = ({
  children,
  isGoogleButton,
  isFacebookButton,
  ...otherProps
}) => (
  <div className="group">
    <button
      className={`
  ${isGoogleButton ? "google-sign-in" : ""} 
  ${isFacebookButton ? "faceook-sign-in" : ""}
  custom-button
  `}
      {...otherProps}
    >
      {children}
    </button>
  </div>
);

export default CustomButton;
